La autonomía de un vehículo es el recorrido máximo que es capaz de efectuar sin necesidad de repostar combustible o, en el caso de tracción eléctrica, para recargar las baterías.  Por ejemplo: “Este vehículo tiene una autonomía de 600 kilómetros”

Esta autonomía viene limitada por la cantidad de combustible transportado; el número de kilómetros que pueden recorrerse sin repostar se calcula multiplicando la capacidad del depósito en litros por el número de kilómetros que el vehículo puede recorrer en promedio con un litro de combustible.
